import SearchBar from '../SearchBar/SearchBar'
import { Link } from "react-router-dom";
import style from "./Nav.modules.css"

const Nav = ({onSearch, addRandomCharacter}) => {
    const handleAddRandomCharacter = () => {
        addRandomCharacter();
    };
    return (
        <div>
            <SearchBar onSearch={onSearch} />
            <div className={style.btnRandom}>
            <button onClick={handleAddRandomCharacter}>Add Random</button>
            </div>
            <div >
            <Link to= "/home">
                <button>HOME</button>
            </Link>
            <Link to= "/about">
                <button>ABOUT</button>
            </Link>
            <Link to= "/">
                <button>LOG OUT</button>
            </Link>
            <Link to= "/favorites">
                <button>FAVORITES</button>
            </Link>
            </div>
        </div>
    );
}

export default Nav;
